import React from 'react'
import './News.css'

const News = () => {
  return (
    <div className='news'>
        <h2>News</h2>
        <p>Welcome to the CPFRA website.</p>
        <hr />
        <p>To download or print the current year's Medical Claim and Beneficiary forms, please click the link above.</p>
    </div>
  )
}

export default News
